--
-- Table structure for table `departments`
--

DROP TABLE IF EXISTS `departments`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `departments` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'ID Đơn vị\r\n',
  `created_time` datetime NOT NULL COMMENT 'Ngày tạo\r\n',
  `created_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT 'Người tạo\r\n',
  `update_time` datetime DEFAULT NULL COMMENT 'Ngày cập nhật\r\n',
  `update_name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Người cập nhật\r\n',
  `name` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Tên Đơn vị\r\n\r\n',
  `code` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '0' COMMENT 'Mã đơn vị\r\n',
  `parent_id` int DEFAULT NULL COMMENT 'Đơn vi cha',
  `position` int DEFAULT NULL COMMENT 'Chức vụ: \r\n0- Hiệu Trưởng, \r\n1- Trưởng phòng,\r\n 2- Trưởng Khoa/Ban,\r\n 3- Trưởng Tổ bộ môn, \r\n4- Trưởng bộ môn',
  `employee_id` int DEFAULT NULL COMMENT 'Người phụ trách. Link đến bảng ',
  `description` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT 'Mô tả nhiệm vụ',
  `type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Loại đơn vị; join bảng app_param để lấy loại đơn vị theo trường app_param.code và điều kiện type = ''DEPT''',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=75 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC;
