--
-- Table structure for table `students`
--

DROP TABLE IF EXISTS `students`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
 SET character_set_client = utf8mb4 ;
CREATE TABLE `students` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'ID Học sinh/Sinh viên',
  `created_time` datetime NOT NULL COMMENT 'Ngày tạo\r\n',
  `created_name` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Người tạo\r\n',
  `update_time` datetime DEFAULT NULL COMMENT 'Ngày cập nhật\r\n',
  `update_name` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Người cập nhật\r\n',
  `full_name` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'Họ và tên\r\n',
  `code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT '0' COMMENT 'Mã học sinh',
  `dept_id` int NOT NULL COMMENT 'Khoa/Ban Link từ bảng departments',
  `start_date` datetime DEFAULT NULL COMMENT 'Ngày vào trường',
  `phone` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Số điện thoại',
  `email` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Email',
  `birth_day` datetime DEFAULT NULL COMMENT 'Ngày sinh',
  `home_town` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Quê quán',
  `nation` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Dân tộc',
  `permanent_address` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Địa chỉ thường trú',
  `social_insurance_number` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Số BHXH',
  `identity_card` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Chứng minh nhân dân',
  `issued_address` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Nơi cấp',
  `issued_date` datetime DEFAULT NULL COMMENT 'NGày cấp',
  `sex` int DEFAULT NULL COMMENT 'Giới tính : 0-Nam, 1- Nữ',
  `avatar` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT 'Avatar',
  `elect_format` int DEFAULT NULL COMMENT 'Hình thức trúng tuyển: 1- Thi tuyển; 0- Xét tuyển',
  `graduation_type` int DEFAULT NULL COMMENT 'Loại tốt nghiệp: 1-Giỏi; 2-Khá;3- Trung bình',
  `status` int DEFAULT NULL COMMENT 'Trạng thái: \r\n0-Đang học, 1-bảo lưu,2-Đã thôi học, 3-Đã chuyển trường',
  `training_system` int DEFAULT NULL COMMENT 'Hệ đào tạo: 1- Chính quy; 2- Tại Chức; 3- Vừa học vừa làm; 4- Liên thông; 5- Đào tạo nghề; 6- Hợp tác đào tạo',
  `religion` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Tôn Giáo',
  `temporary_address` varchar(250) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'Địa chỉ tạm trú',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=934 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC;
/*!40101 SET character_set_client = @saved_cs_client */;

